import "./table.css"
import { useSelector } from 'react-redux';

const Table = () => {
    useEffect(() => {
        dispatch(getPosts());
    }, [currentId, dispatch]);
    const posts = useSelector((state) => state.posts);
    console.log(posts)
    return(
        <>
            <div className="App">
            <table>
                <tr>
                <th>First Name</th>
                <th>Last Name</th>
                <th>CNIC</th>
                <th>Work</th>
                <th>Contact</th>
                <th>Salary</th>
                <th>Description</th>
                </tr>
                
                {posts.map((val, key) => {
                return (
                    <tr key={key}>
                    <td>{val.firstName}</td>
                    <td> {val.lastName}</td>
                    <td> {val.cnic}</td>
                    <td> {val.work}</td>
                    <td> {val.contact}</td>
                    <td> {val.salary}</td>
                    <td> {val.description}</td>
                    </tr>
                )
                })}
            </table>
            </div>

        </>
    );
}

export default Table;
